   return (
    <div>
      <MyLayout>
       <p>Faites votre recherche</p>
       <input></input>
       <input type="text" value={this.kkk.value} onChange={this.handleChange}/>
       <button>Chercher {kkk}</button>
      </MyLayout>
    </div>
  )

 function handleChange(value) {

  this.setState({title: event.target.value})

 }
}
